let content = null;
console.log('temp', {temp})
if(!err && city){
    content = (
        <div> 
            <img src={icons_img} alt={description} />
        </div>
    )

}

else if (err) {
    content = (
        <div> 
        </div>
    )

}



return (
        <div className="Visual">
            {err ? `picture not available` 
            :content}
        </div>


  );
}

export default Visual;
